import React from 'react';
import './Person.css'


const person = (props) => {

    return (
        <div className="Person">
    <p onClick={props.click}>{props.id}Hello I am {props.name} I stay in {props.place} </p>
    <input type="text" onChange = {props.changed} value = {props.name}/>
    </div>
    )
};


export default person;
